    "["Use Constraints: The hardcopy FIRM and DFIRM and the accompanying FISs are
    the official designation of SFHAs and Base Flood Elevations (BFEs) for the NFIP.
    For the purposes of the NFIP, changes to the flood risk information published by
    FEMA may only be performed by FEMA and through the mechanisms established in the
    NFIP regulation (44 CFR Parts 59-78). These digital data are produced in conjunction
    with the hardcopy FIRMs and generally match the hardcopy map exactly. However the
    hardcopy flood maps and flood profiles are the authoritative documents for the NFIP.
